import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg bg-white shadow-sm">
      <div className="container">
        <ul className="navbar-nav mx-auto">
          <li className="nav-item">
            <Link to="/" className="nav-link mx-3 text-dark">Accueil</Link>
          </li>
          <li className="nav-item">
            <Link to="/materiels" className="nav-link mx-3 text-dark">Remorques</Link>
          </li>
          <li className="nav-item">
            <Link to="/devis" className="nav-link mx-3 text-dark">Devis</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
